func TestJplEph(t *testing.T) {
	for _, expected := range eph_test {
		actual, err := Jpl_eph(expected.body,expected.jd)
		if nil != err {
			t.Errorf(err.Error())
		} else {
			for i := 0; i < 6; i++ {
				if !equal_f(actual[i],expected.pv[i]) {
					t.Errorf("Jpl_eph(%v,%f): [%d] expected %.13f, actual %.13f",expected.body,expected.jd, i, expected.pv[i] ,actual[i])
				}
			}
		}
	}
}

